import React, { useEffect, useState } from 'react';
import { fetchUserProfile } from '../../service/api';
import { useAuth } from '../../context/AuthContext';
import { useNavigate } from 'react-router-dom';

const Profile = () => {
  const { authTokens, logout } = useAuth();
  const [profile, setProfile] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const getUserProfile = async () => {
      try {
        const response = await fetchUserProfile(authTokens);
        setProfile(response.data);
      } catch (err) {
        console.error('Failed to fetch user profile', err);
      }
    };

    getUserProfile();
  }, [authTokens]);

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  if (!profile) return <p>Loading profile... ‚è≥</p>;

  return (
    <div>
        <div
              class="bg-white shadow-[0_4px_12px_-5px_rgba(0,0,0,0.4)] w-full max-w-sm rounded-lg font-[sans-serif] overflow-hidden mx-auto mt-4">
              <div class="p-6">
                <h3 class="text-lg font-semibold">

                User Profile üë§ </h3>
                <p class="mt-2 text-sm text-gray-500 leading-relaxed"> 
                  <p><strong>Username:</strong> {profile.username}</p>
                   <p><strong>Email:</strong> {profile.email}</p>
                 </p>

                <button type="button"
                  class="mt-4 px-5 py-2.5 rounded-lg text-white text-sm tracking-wider border-none outline-none bg-blue-600 hover:bg-blue-700">View</button>
              </div>
            </div>

             {/* <div class="relative inline-block">
                <img src="https://readymadeui.com/team-4.webp" class="w-14 h-14 rounded-full border-2 border-blue-600 p-0.5" />
                <span class="h-3 w-3 rounded-full border border-white bg-green-500 block absolute top-1 right-0"></span>
              </div>  */}




      <button 

      onClick={handleLogout}  
      className="mt-8 bg-red-600 text-white px-6 py-2 rounded hover:bg-red-700 transition duration-300" >
              Logout üö™ </button>
    </div>
  );
};

export default Profile;
